// src/components/PropertyListContainer.js

import React, { useState } from 'react';
import PropertyList from './PropertyList'; // Import the PropertyList component

const PropertyListContainer = () => {
  // State for properties
  const [properties] = useState([
    { id: 1, title: 'Modern Villa', location: 'Los Angeles', price: 500000, image: require('../assets/1.jpeg') },
    { id: 2, title: 'Cozy Apartment', location: 'New York', price: 300000, image: require('../assets/2.jpeg') },
    { id: 3, title: 'Luxury House', location: 'Miami', price: 400000, image: require('../assets/3.jpeg') },
    { id: 4, title: 'Spacious Condo', location: 'Seattle', price: 750000, image: require('../assets/4.jpeg') },
    { id: 5, title: 'Charming Bungalow', location: 'Chicago', price: 650000, image: require('../assets/5.jpeg') },
    { id: 6, title: 'Stylish Loft', location: 'San Francisco', price: 800000, image: require('../assets/6.jpeg') },
  ]);

  return (
    <section className="combined-listings">
      <h2>Properties</h2>
      <div className="listing-cards">
        <PropertyList properties={properties} />
      </div>
    </section>
  );
};

export default PropertyListContainer;
